#define PROBLEM "https://yukicoder.me/problems/no/502"
//
#include <iostream>
#include <string>
using namespace std;

#include "../../misc/base64.hpp"

string S ="";

int main() {
  constexpr int mod = 1000000007, Z = 100000;
  if (0) {
    int M = mod / Z + 2;
    vector<long long> v(M);
    v[0] = 1;
    for (long long i = 1, x = 1; i < M * Z; i++) {
      x = x * i % 1000000007;
      if (i % Z == 0) v[i / Z] = x;
    }
    cout << Base64::encode(v) << "\n";
    return 0;
  }

  auto a = Base64::decode(S);
  long long N;
  cin >> N;
  N = min(N, 1000000007LL);
  long long x = a[N / Z];
  for (long long b = N / Z * Z + 1; b <= N; b++) {
    x = x * b % 1000000007;
  }
  cout << x << "\n";
}
